import Header from './../Header/Header.jsx';
import './app.css';
import SearchBox from './../SearchBox/SearchBox.jsx';


// Class Component
class App extends React.Component
{
    state = {
        headertext: "Name it!"
    };

    render()
    {
        return (
            <div>
                <Header headtitle={this.state.headertext} />
                <SearchBox/>
                
            </div>
        );
    }
    
}



export default App;
